  return (
    <Grid container spacing={1}>
      <Grid item sm={12} xs={12}>
        <Typography variant="body1" component="h1">
          <Box fontWeight="fontWeightMedium">Öne Çıkan Yorum</Box>
        </Typography>
      </Grid>
      <Grid item sm={8} xs={12}>
        <Comment></Comment>
      </Grid>
    </Grid>
  );
}
